import React, { useState, useEffect } from "react";
import "./App.css";
import anh from '../src/assets/test.jpg';
const YOUR_API_KEY = "AIzaSyA3bsDl1xddiU_w38hA-fsGea8kWsp5uJM";

function App() {
  const [opacity, setOpacity] = useState(0.5);
  const [map, setMap] = useState(null);
  const [overlay, setOverlay] = useState(null);

  useEffect(() => {
    // Load Google Maps API script
    const googleScript = document.createElement("script");
    googleScript.src = `https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY`;
    googleScript.onload = initMap;
    document.head.appendChild(googleScript);

    // Initialize Google Maps
    function initMap() {
      const mapOptions = {
        zoom: 14,
        center: { lat: 37.774929, lng: -122.419416 }
      };
      const map = new window.google.maps.Map(
        document.getElementById("map"),
        mapOptions
      );
      setMap(map);

      // Initialize image overlay
      const overlay = new window.google.maps.GroundOverlay(
        "/path/to/your/image.jpg",
        map.getBounds()
      );
      overlay.setMap(map);
      setOverlay(overlay);
    }
  }, []);

  useEffect(() => {
    if (overlay) {
      overlay.setOpacity(opacity);
    }
  }, [opacity, overlay]);

  const handleOpacityChange = (e) => {
    setOpacity(e.target.value);
  };

  return (
    <div className="app">
      <div id="map" className="map"></div>
      <div className="image-overlay">
        <img
          src="/path/to/your/image.jpg"
          alt="Overlay"
          style={{ opacity: opacity }}
        />
        <input
          type="range"
          min="0"
          max="1"
          step="0.01"
          value={opacity}
          onChange={handleOpacityChange}
        />
      </div>
    </div>
  );
}

export default App;
